import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import AdminSidebar from './AdminSidebar';
import { adminService } from '../../services/api'; // Import admin service
import '../../styles/Admin.css';

const AdminOrders = () => {
  const { currentUser } = useAuth();
  const navigate = useNavigate();
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filterStatus, setFilterStatus] = useState('all');
  const [selectedOrder, setSelectedOrder] = useState(null);

  useEffect(() => {
    if (!currentUser?.isAdmin) {
      navigate('/');
      return;
    }

    fetchOrders();
  }, [currentUser, navigate]);

  const fetchOrders = async () => {
    try {
      console.log('Fetching orders...');
      const data = await adminService.getAllOrders();
      console.log('Orders data received:', data);
      setOrders(data);
    } catch (error) {
      console.error('Error fetching orders:', error);
    } finally {
      setLoading(false);
    }
  };

  const updateOrderStatus = async (orderId, status) => {
    try {
      const updatedOrder = await adminService.updateOrderStatus(orderId, status);
      setOrders(orders.map(order => 
        order._id === orderId ? updatedOrder : order
      ));
    } catch (error) {
      console.error('Error updating order:', error);
    }
  };

  const filteredUsers = users.filter(user =>
    user.displayName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    user.email.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) {
    return <div className="loading">Loading users...</div>;
  }

  return (
    <div className="admin-container">
      <AdminSidebar activeTab="users" />
      
      <main className="admin-content">
        <h1 className="admin-title">User Management</h1>
        
        <div className="admin-controls">
          <input
            type="text"
            placeholder="Search users..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            className="admin-search"
          />
        </div>

        <div className="table-responsive">
          <table className="admin-table">
            <thead>
              <tr>
                <th>Avatar</th>
                <th>Name</th>
                <th>Email</th>
                <th>Admin</th>
                <th>Active</th>
                <th>Member Since</th>
                <th>Orders</th>
              </tr>
            </thead>
            <tbody>
              {filteredUsers.map(user => (
                <tr key={user._id}>
                  <td>
                    <img 
                      src={user.profileImage} 
                      alt={user.displayName}
                      className="user-avatar-small"
                    />
                  </td>
                  <td>{user.displayName}</td>
                  <td>{user.email}</td>
                  <td>
                    <label className="toggle-switch">
                      <input
                        type="checkbox"
                        checked={user.isAdmin}
                        onChange={(e) => updateUserStatus(user._id, { 
                          isAdmin: e.target.checked 
                        })}
                      />
                      <span className="toggle-slider"></span>
                    </label>
                  </td>
                  <td>
                    <label className="toggle-switch">
                      <input
                        type="checkbox"
                        checked={user.isActive}
                        onChange={(e) => updateUserStatus(user._id, { 
                          isActive: e.target.checked 
                        })}
                      />
                      <span className="toggle-slider"></span>
                    </label>
                  </td>
                  <td>{new Date(user.memberSince).toLocaleDateString()}</td>
                  <td>{user.orders?.length || 0}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </main>
    </div>
  );
};

export default AdminUsers;
